def pdb_on_crash(f):
    """
    Decorator to run PDB on crashing  
    """
    def res(*args, **kwargs):
        try:
            return f(*args, **kwargs)
        except:
            import pdb as err_pdb
            err_pdb.post_mortem()
    return res

